import React, { Component } from "react";

class Profile extends Component {
    constructor(props) {
      super(props);
      this.state = {
        currentUser: []
      }
  
    }
  
    getCurrentUser(uData) {
      this.setState({getCurrentUser : uData})
    }
  
    render() {
  
      return (
      <div>
        {/* <Nav
          onGetUserData={this.getUserData.bind(this)} />
        <ProfileHeader /> */}
        <Profile
          routeParams={this.props.params}
          onGetCurrentUser={this.getCurrentUser.bind(this)} />
       
      </div>
      )
    }
  }

